import { Component, React } from "react";
import Header from "../components/header/Header";
import Textbox from "./Textbox";

class Signup extends Component{
    constructor(props){
        super(props)
        this.state={
            user:{
                fullName:'',
                dob:'',
                email:'',
                phone:'',
                password:'',
                cpassword:''
            }
        }
    }
    inputDataChange=(event)=>{
        this.setState({
            user:{
                fullName:event.target.value,
                dob:event.target.value,
                email:event.target.value,
                phone:event.target.value,
                password:event.target.value,
                cpassword:event.target.value
            }
        })
    testFun=()=>{
        console.log(this.state.fullName);
    }
    }
    render(){
        return(
            <div>
                <Header/>
                <h2>Sign up to get started. It's free and always will be.</h2>
                <div className="container">
                    <Textbox name={this.state.fullName} inputDataChange={this.state.inputDataChange}/>
                    <Textbox name={this.state.email} inputDataChange={this.state.inputDataChange}/>
                    <Textbox name={this.state.phone} inputDataChange={this.state.inputDataChange}/>
                    <Textbox name={this.state.dob} inputDataChange={this.state.inputDataChange}/>
                    <Textbox name={this.state.password} inputDataChange={this.state.inputDataChange}/>
                    <Textbox name={this.state.cpassword} inputDataChange={this.state.inputDataChange}/>
                    <button onClick={this.state.testFun}>Signup</button>
                </div>
            </div>
            )
        }
}
export default Signup;
